import { testimonialImages } from '../../Interfaces/content';
import { Component, Input } from '@angular/core';

@Component({
    selector: 'app-testimonial-images',
    templateUrl: './testimonial-images.component.html',
    styleUrls: ['./testimonial-images.component.css']
})
export class TestimonialImagesComponent {
    @Input() images: testimonialImages = {
		type: 'testimonialImages',
		imgURL1: '',
		imgURL2: '',
		imgURL3: '',
		imgURL4: '',
		imgURL5: '',
		imgURL6: '',
	}
}
<div class="container">
    <img [src]="images.imgURL1">
    <img [src]="images.imgURL2">
    <img [src]="images.imgURL3">
</div>
<div class="container">
    <img [src]="images.imgURL4">
    <img [src]="images.imgURL5">
    <img [src]="images.imgURL6">
</div>
